INSERT INTO `ejercicioalumno` (`idEjercicio`, `solucion`, `nota`, `numFallos`, `entregaRetrasada`, `correccionProfesor`, `idAlumno`, `idGrupo`, `intentos`, `resultado`, `fecha`) VALUES
(94, 'CREATE OR REPLACE PROCEDURE ventas_por_puerta(p_puerta accesos.puerta%TYPE) AS\nCURSOR c_taquillas IS\n  SELECT taquilla\n  FROM taquillas\n  WHERE puerta=p_puerta;\nv_taquilla taquillas.taquilla%TYPE;\nCURSOR c_clientes IS\n  SELECT DNIcliente, SUM(precio) AS importe, COUNT(*) AS tickets\n  FROM tickets JOIN taquillas USING (taquilla)\n  WHERE taquilla=v_taquilla AND puerta = p_puerta\n  GROUP BY DNIcliente;\n \nv_existe_puerta INTEGER;\nv_taquilla_tickets NUMBER(5,0);\nv_taquilla_ventas  NUMBER(7,2);\nv_puerta_ventas NUMBER(8,2) := 0;\n \ne_sin_venta EXCEPTION;\n \nBEGIN\n  SELECT 0 INTO v_existe_puerta FROM accesos WHERE puerta=p_puerta;\n \n  FOR r_taquilla IN c_taquillas LOOP\n    DBMS_OUTPUT.PUT_LINE(\'Taquilla: \' || r_taquilla.taquilla);\n    v_taquilla_tickets := 0;\n    v_taquilla_ventas := 0.0;\n    v_taquilla := r_taquilla.taquilla;\n  \n    FOR r_clientes IN c_clientes LOOP\n    	DBMS_OUTPUT.PUT_LINE(\'	DNI: \' || r_clientes.DNIcliente || \', importe: \' ||\n            TO_CHAR(r_clientes.tickets,\'999D99\') || \', tickets: \' || r_clientes.importe);\n       	v_taquilla_ventas := v_taquilla_ventas + r_clientes.importe;\n       	v_taquilla_tickets := v_taquilla_tickets + r_clientes.tickets;\n    END LOOP;\n    DBMS_OUTPUT.PUT_LINE(\'	Total: \' || v_taquilla_ventas || \' eur (\' || v_taquilla_tickets || \' tickets)\');\n    v_puerta_ventas := v_puerta_ventas + v_taquilla_ventas;\n\n    UPDATE taquillas SET ventas=v_taquilla_ventas WHERE taquilla=r_taquilla.taquilla;\n  END LOOP;\n  IF v_puerta_ventas=0 THEN RAISE e_sin_venta; END IF;\n \nEXCEPTION\n  WHEN NO_DATA_FOUND THEN\n    DBMS_OUTPUT.PUT_LINE(\'La puerta \' || p_puerta || \' no existe.\');\n  WHEN e_sin_venta THEN\n    DBMS_OUTPUT.PUT_LINE(\'La puerta \' || p_puerta || \' no tiene entradas vendidas.\');\nEND;', 50, 0, '2019-06-03', 'Has mostrado mal el orden de los datos de las columnas \n\nCREATE OR REPLACE PROCEDURE ventas_por_puerta(p_puerta accesos.puerta%TYPE) AS\nCURSOR c_taquillas IS\n  SELECT taquilla\n  FROM taquillas\n  WHERE puerta=p_puerta;\nv_taquilla taquillas.taquilla%TYPE;\nCURSOR c_clientes IS\n  SELECT DNIcliente, SUM(precio) AS importe, COUNT(*) AS tickets\n  FROM tickets JOIN taquillas USING (taquilla)\n  WHERE taquilla=v_taquilla AND puerta = p_puerta\n  GROUP BY DNIcliente;\n \nv_existe_puerta INTEGER;\nv_taquilla_tickets NUMBER(5,0);\nv_taquilla_ventas  NUMBER(7,2);\nv_puerta_ventas NUMBER(8,2) := 0;\n \ne_sin_venta EXCEPTION;\n \nBEGIN\n  SELECT 0 INTO v_existe_puerta FROM accesos WHERE puerta=p_puerta;\n \n  FOR r_taquilla IN c_taquillas LOOP\n    DBMS_OUTPUT.PUT_LINE(\'Taquilla: \' || r_taquilla.taquilla);\n    v_taquilla_tickets := 0;\n    v_taquilla_ventas := 0.0;\n    v_taquilla := r_taquilla.taquilla;\n  \n    FOR r_clientes IN c_clientes LOOP\n    	DBMS_OUTPUT.PUT_LINE(\'	DNI: \' || r_clientes.DNIcliente || \', importe: \' ||\n            TO_CHAR(r_clientes.tickets,\'999D99\') || \', tickets: \' || r_clientes.importe);\n       	v_taquilla_ventas := v_taquilla_ventas + r_clientes.importe;\n       	v_taquilla_tickets := v_taquilla_tickets + r_clientes.tickets;\n    END LOOP;\n    DBMS_OUTPUT.PUT_LINE(\'	Total: \' || v_taquilla_ventas || \' eur (\' || v_taquilla_tickets || \' tickets)\');\n    v_puerta_ventas := v_puerta_ventas + v_taquilla_ventas;\n\n    UPDATE taquillas SET ventas=v_taquilla_ventas WHERE taquilla=r_taquilla.taquilla;\n  END LOOP;\n  IF v_puerta_ventas=0 THEN RAISE e_sin_venta; END IF;\n \nEXCEPTION\n  WHEN NO_DATA_FOUND THEN\n    DBMS_OUTPUT.PUT_LINE(\'La puerta \' || p_puerta || \' no existe.\');\n  WHEN e_sin_venta THEN\n    DBMS_OUTPUT.PUT_LINE(\'La puerta \' || p_puerta || \' no tiene entradas vendidas.\');\nEND;', 35, 16, 3, '-- --------------------------------------------------------------\r\n-- PRUEBA 1: Ejecucion correcta del procedimiento.\r\n-- Ejecucion con datos, comprobacion de calculos y de excepciones.\r\n-- --------------------------------------------------------------\r\n-- \r\nTaquilla: 1101\r\n	DNI: 4405Y, importe:    2,00, tickets: 21,45\r\n	DNI: 4401Y, importe:    1,00, tickets: 12\r\n	Total: 33,45 eur (3 tickets)\r\nTaquilla: 1102\r\n	DNI: 4402Y, importe:    1,00, tickets: 8,45\r\n	DNI: 4404Y, importe:    1,00, tickets: 12\r\n	Total: 20,45 eur (2 tickets)\r\n-- Las comprobaciones de prueba son correctas, pero comprueba que la salida \r\n-- por consola sea idC)ntica a la esperada para confirmar que el resultado\r\n-- final es correcto.\r\n\r\n-- --------------------------------------------------------------\r\n-- PRUEBA 2: Ejecucion de excepcion del procedimiento.\r\n-- debe capturar excepcion para indicar que la puerta no existe.\r\n-- Ademas se comprueba si se han modificado las ventas de las taquillas.\r\n-- --------------------------------------------------------------\r\n-- \r\nLa puerta Sureste no existe.\r\n-- Las comprobaciones de prueba son correctas, pero comprueba que la salida \r\n-- por consola sea idC)ntica a la esperada para confirmar que el resultado\r\n-- final es correcto.\r\n\r\n-- --------------------------------------------------------------\r\n-- PRUEBA 3: Ejecucion de excepcion del procedimiento.\r\n-- debe capturar excepcion para indicar que la puerta no tiene\r\n-- entradas vendidas.\r\n-- --------------------------------------------------------------\r\n-- \r\nLa puerta Oeste no tiene entradas vendidas.\r\n-- Las comprobaciones de prueba son correctas, pero comprueba que la salida \r\n-- por consola sea identica a la esperada para confirmar que el resultado\r\n-- final es correcto.\r\n\r\n', NULL);

